    gettextCatalog.setStrings('de', {"Send":"Abschicken","Exercise, nutrition, relaxation, breathing, sleep, love, work and fun are of equal importance in our lives":"Bewegung, Ernährung, Entspannung, Atmung, Schlaf, Liebe, Arbeit und Spaß sind gleichermaßen wichtig","Thank you for your feedback!":"Danke für Dein Feedback!","Thank you! ":"Danke!","Your E-mail Address":"Deine E-Mail-Adresse","Your benefits":"Deine Vorteile","The e-mail address is incorrect":"Die Email-Adresse ist nicht korrekt","Unleash your full potential":"Dieses Potenzial kannst Du entfalten","Know your worth":"Du bist wertvoll","You have unique potential":"Du hast ein ganz eigenes Potenzial","You have a free trial period, short contract terms and details about every class at your fingertips.":"Du hast eine kostenlose Probezeit, kurze Vertragslaufzeiten und findest jeden Kurs in Sekunden.","You pay a fraction of what you would for each individual class. Once you have your card, all the costs are covered.":"Du zahlst einen Bruchteil dessen, was die Kurse einzeln kosten. Mit der Karte ist alles bezahlt.","A holistic lifestyle begins with mindfulness":"Ein ganzheitliches Leben beginnt mit Achtsamkeit","E-mail Address":"Email-Adresse","Discover Somuchmore":"Entdecke Somuchmore","You can only develop personally if you are inspired and free":"Entfaltung gelingt nur mit Inspiration und Spaß","Get your invitation":"Erhalte Deine Einladung","Ask a question":"Frage eingeben","Do you have any questions?":"Hast Du noch Fragen?","Do you fully understand how Somuchmore works now? How do you like it?":"Ist es uns gelungen, Dir Somuchmore zu erklären? Und gefällt Dir unser Ansatz?","Yesss!":"Jaaa!","Everyone has the potential to live healthily and happily if they want to.":"Jeder Mensch kann gesund und glücklich leben, wenn er will und man ihn lässt","All of the studios we work with fulfill the highest quality standards, and every teacher qualified to the highest standards in their field. We verify everything personally to ensure you have the best experience possible.":"Jedes Studio erfüllt hohe Qualitätsstandards, jeder Lehrer ist zertifiziert. Wir prüfen alles persönlich.","Body, mind and soul united":"Körper, Geist und Seele sind eins","Unfortunately not":"Leider nicht","With Somuchmore you can experience hundreds of health and fitness classes all over your city.  From Yoga, Pilates, Meditation, Martial Arts, Dance, Nutrition, Health and Personal Growth classes and workshops, you will be amazed what is offer around you with Somuchmore. ":"Mit der Somuchmore Card kannst Du hunderte Kurse für Yoga, Pilates, Kampfkunst, Fitness, Tanz, Meditation, Ernährung, Gesundheit und persönliches Wachstum besuchen, neue Studios entdecken und Dich täglich inspirieren lassen.","One card. Unlimited classes.":"Mit einer Karte bist Du überall willkommen.","Somuchmore is new online wellbeing community. Your gateway to a fulfilled, mindful and active life.":"Somuchmore ist eine Plattform für ganzheitliche Lebensweise.","Our philosophy:":"Unsere Überzeugung:"});
