    gettextCatalog.setStrings('de', {"Beginners":"Anfänger","Medium":"Medium","Advanced ":"Fortgeschrittene","Meditation can increase your brain capacity to that of a 25-year-old.":"Meditation kann Dir die Gehirnkapazität eines 25-jährigen erhalten.","— NCBI (National Center for Biotechnology Information)":"— NCBI (National Center for Biotechnology Information)","Yoga has been proven to help self-image and self-love after just 3 months.":"Yoga kann schon nach 3 Monaten Dein Selbstbild anheben.","Dancing helps to alleviate depression.":"Tanzen hilft gegen Depressionen.","People who meditate are able to deal with everyday challenges more creatively.":"Menschen, die meditieren, lösen Herausforderungen des Alltags kreativer.","— WSU (Washington State University)":"— WSU (Washington State University)","Yoga helps to reduce anxiety and manage stress.":"Yoga kann Angst dauerhaft reduzieren.","Your password is too weak; it must contain at least 8 characters, including numbers and lower and uppercase letters":"Das Passwort ist zu schwach, muss mindestens 8 Zeichen sein, mit Ziffern, Groß und Kleinbuchstaben","The link is no longer valid":"Der Link ist nicht mehr gültig","The link is invalid":"Der Link ist nicht gültig","I don’t have a credit card, but still wish to order the Somuchmore card. Please contact me!":"Ich habe keine Kreditkarte, möchte die Somuchmore Card aber trotzdem bestellen. Bitte kontaktiert mich dazu!","Unlimited":"Unbegrenzt","Anytime":"Jederzeit","Selected":"Ausgewählt","Select":"Auswählen"});
