    gettextCatalog.setStrings('de', {"You are already everything you want to be.":"Alles, was Du sein willst, ist schon da.","Beginners or advanced classes, in a small group or one-on-one: you will enjoy a fantastic session that is tailored to you.":"Anfänger oder Fortgeschrittener, in kleiner Gruppe oder alleine: Du erlebst eine wunderbare, auf Dich zugeschnittene Stunde.","Connection":"Connection","Core":"Core","The decision is yours!":"Du entscheidest!","No one else has the same set of talents as you – you have every right in the world to develop your true self.":"Du hast Talente, die kein anderer Mensch hat – und jedes Recht auf der Welt, Deinen wahren Kern ganz zu entfalten.","You don’t need to do anything to be good, beautiful or valuable. You are all those things already!":"Du musst nichts machen, um gut, schön oder wertvoll zu sein. Du bist es schon!","Discover yoga, meditation, climbing, holistic fitness and wellness, singing, speech coaching, business communications, spiritual growth – or whatever it is you always wanted to do.":"Entdecke Yoga, Meditieren, Klettern, ganzheitliche Fitness und Wellness, Singen, Sprechen, beruflich kommunizieren, spirituelle Weisheit - oder was Du immer schon mal machen wolltest.","You want to be relaxed, fit and attractive? To enjoy a healthy diet and lifestyle? To realise your full potential in your personal or professional life? To experience intense feelings and thrilling sex with your partner? And happiness with your family and friends?":"Entspannt, fit und attraktiv sein? Genussvoll und gesund essen und leben? Dich persönlich oder beruflich verwirklichen? Intensive Gefühle, spannenden Sex haben und Glück mit Dir selbst und mit Partner, Familie und Freunden erleben?","It’s all about you.":"Es geht um Dich.","Holistic lifestyle":"Holistic Lifestyle","Body, mind, soul, health, love, work, family: a holistic lifestyle means balance – and is the key to power, health and deeper fulfilment.":"Körper, Geist, Seele und Gesundheit, Liebe, Arbeit, Familie: ein holistic lifestyle bedeutet Ausgewogenheit – und den Schlüssel zu Power, Gesundheit und tiefer Erfüllung.","Be coached on how to develop your true potential.":"Lass Dir zeigen, wie Du es entfaltest.","People, animals, nature and the universe are all deeply interconnected – and this bond with the very root of existence is the source of all vitality and joy of life.":"Menschen, Tiere, Natur, Kosmos sind tief verbunden – und aus dieser Verbundenheit mit dem Leben entspringen alle Kraft und Lebensfreude.","Our teachers are exceptional people – and the best in their field.":"Unsere Lehrer sind außergewöhnliche Menschen – und die Besten ihres Fachs.","Who do you want to be?":"Wer willst Du sein?","All of our listed trainers and coaches have been handpicked by us personally and will take care of you individually.":"Wir wählen jeden persönlich aus, dass er sich persönlich um Dich kümmert.","You are so much more.":"You are so much more."});
